script: |
  super -f text -I q12364.spq | sort > q12364.out

inputs:
  - name: q12364.spq
    data: |
      SELECT ALL + col2 / - col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN col2 * + 33 AND + - col0 * + + 85 + col2 - - col0 + + - col2 * col2 - - col1;
  - name: tab0

outputs:
  - name: q12364.out
    data: |
